import React from "react";
import desam from "../img/desam.png";
import { Link } from "react-router-dom";
import { HashLink } from "react-router-hash-link";

const Footer = () => {
  const currentYear = new Date().getFullYear();

  return (
    <>
      {/* Inline CSS */}
      <style>
        {`
          .footer {
            background: #111;
            color: #fff;
            padding: 15px 0;
          }

          .footer-content {
            padding: 10px 0;
          }

          .footer .footer-links ul {
            list-style: none;
            padding: 0;
            margin: 0;
          }

          .footer .footer-links li {
            margin-bottom: 5px;
          }

          .footer .footer-links a {
            color: #ddd;
            text-decoration: none;
            font-size: 14px;
          }

          .footer .footer-links a:hover {
            color: #fff;
          }

          .footer .logo img {
            max-height: 45px;
          }

          .footer h4 {
            font-size: 16px;
            margin-bottom: 10px;
          }

          .footer-legal {
            text-align: center;
            padding: 8px 0;
            font-size: 13px;
            border-top: 1px solid #222;
            margin-top: 10px;
          }

          .footer a {
            color: #aaa;
          }

          .footer a:hover {
            color: #fff;
          }
        `}
      </style>

      <footer id="footer" className="footer">
        <div className="footer-content">
          <div className="container">
            {/* Reduced spacing */}
            <div className="row gy-2">
              
              {/* Logo & Social */}
              <div className="col-lg-4 col-md-12 footer-info">
                <Link to="/" className="logo d-flex align-items-center">
                  <img src={desam} alt="DESAM Logo" />
                </Link>

                <div className="social-links d-flex mt-2">
                  <Link to="/" className="me-2">
                    <i className="bi bi-twitter"></i>
                  </Link>

                  <Link
                    to="https://www.facebook.com/DESAM2002"
                    target="_blank"
                    rel="noreferrer"
                  >
                    <i className="bi bi-facebook"></i>
                  </Link>
                </div>
              </div>

              {/* Useful Links */}
              <div className="col-lg-2 col-6 footer-links">
                <h4>Useful Links</h4>
                <ul>
                  <li><Link to="/">Home</Link></li>
                  <li><Link to="/about">About Us</Link></li>
                  <li><Link to="/services">Services</Link></li>
                  <li><Link to="/careers">Careers</Link></li>
                  <li><Link to="/contact">Contact Us</Link></li>
                </ul>
              </div>

              {/* Services */}
              <div className="col-lg-3 col-6 footer-links">
                <h4>Our Services</h4>
                <ul>
                  <li>
                    <HashLink smooth to="/services/#Educational-content">
                      Educational Content
                    </HashLink>
                  </li>
                  <li>
                    <HashLink smooth to="/services/#Entertainment-content">
                      Entertainment Content
                    </HashLink>
                  </li>
                  <li>
                    <HashLink smooth to="/services/#Games">
                      Games
                    </HashLink>
                  </li>
                  <li>
                    <HashLink smooth to="/services/#Sports">
                      Sports
                    </HashLink>
                  </li>
                </ul>
              </div>

              {/* Contact */}
              <div className="col-lg-3 col-md-12 footer-contact text-center text-md-start">
                <h4>Contact Us</h4>
                <address style={{ fontSize: "14px" }}>
                  Keishampat Junction, <br />
                  Imphal West, Manipur <br />
                  <br />
                  <strong>Phone:</strong> +91 7005291834 <br />
                  <strong>Email:</strong>{" "}
                  <a href="mailto:desamofficial02@gmail.com">
                    desamofficial02@gmail.com
                  </a>
                </address>
              </div>

            </div>
          </div>
        </div>

        {/* Legal */}
        <div className="footer-legal">
          &copy; {currentYear} <strong>DESAM</strong>. All Rights Reserved.
          <div>
            <a
              href="https://pibarel.vercel.app"
              target="_blank"
              rel="noreferrer"
            >
              Developed by Pibarel Maisnam
            </a>
          </div>
        </div>
      </footer>
    </>
  );
};

export default Footer;
